import React from 'react';
import { Redirect } from 'react-router-dom';

const Signout = props => {
  if (localStorage.getItem('userTokenTime')) {
    localStorage.removeItem('userTokenTime');
  }
  return <Redirect to="/login" />;
}

export default Signout;
